import React, { useState, useEffect } from 'react';
import { useNavigate, NavLink } from 'react-router-dom';
import styles from './ClubDashboard.module.css';
import { FaCube, FaChartLine, FaFileDownload, FaTrophy, FaWallet, FaCog, FaHome, FaProductHunt, FaSearch, FaBell, FaUpload, FaChevronRight } from 'react-icons/fa'; // Example icon library


const ClubDashboard = () => {
    const navigate = useNavigate();
    const [clubInfo, setClubInfo] = useState(null);
    const [loading, setLoading] = useState(true);
    const [error, setError] = useState(null);

    useEffect(() => {
        const fetchDashboardData = async () => {
            setLoading(true);
            setError(null);
            try {
                const response = await fetch('http://localhost:3001/api/clubs/dashboard', {
                    method: 'GET',
                    headers: {
                        'Content-Type': 'application/json',
                    },
                    credentials: 'include'
                });

                if (!response.ok) {
                    if (response.status === 401) {
                        console.log('Unauthorized access to dashboard, redirecting to login.');
                        navigate('/login-club');
                        return;
                    }
                    const errorData = await response.json();
                    throw new Error(errorData?.message || `HTTP error! status: ${response.status}`);
                }

                const data = await response.json();
                setClubInfo(data);
                setLoading(false);
            } catch (err) {
                console.error('Error fetching dashboard data:', err);
                setError(err.message || 'Failed to load dashboard data.');
                setLoading(false);
            }
        };

        fetchDashboardData();
    }, [navigate]);

    const handleLogout = async () => {
        try {
            const response = await fetch('http://localhost:3001/api/clubs/logout', {
                method: 'POST',
                headers: {
                    'Content-Type': 'application/json',
                },
                credentials: 'include'
            });

            if (response.ok) {
                console.log('Logout successful, redirecting to login.');
                navigate('/login-club');
            } else {
                const data = await response.json();
                alert(data?.message || 'Logout failed.');
            }
        } catch (err) {
            console.error('Logout error:', err);
            alert('Logout failed due to a network error.');
        }
    };

    const menuItems = [
      { path: '/club-dashboard', label: 'Overview', icon: <FaHome className={styles.sidebarNavItemIcon} /> },
      { path: '/club-dashboard/events', label: 'Events', icon: <FaCalendarAlt className={styles.sidebarNavItemIcon} /> },
      { path: '/club-dashboard/members', label: 'Members', icon: <FaUsers className={styles.sidebarNavItemIcon} /> },
      { path: '/club-dashboard/profile', label: 'Profile', icon: <FaUser className={styles.sidebarNavItemIcon} /> },
      { path: '/club-dashboard/settings', label: 'Settings', icon: <FaCog className={styles.sidebarNavItemIcon} /> },
  ];

    const topProducts = [
        { name: 'Niky - Icon Pack 3D', category: '3D Illustrations', avatar: <FaCube className={styles.productAvatar} /> },
        { name: 'Lika - 3D Abstract', category: '3D Illustrations', avatar: <FaCube className={styles.productAvatar} /> },
        { name: 'Cube 3D', category: '3D Illustrations', avatar: <FaCube className={styles.productAvatar} /> },
        { name: 'Heady - 3D Head', category: '3D Illustrations', avatar: <FaCube className={styles.productAvatar} /> },
        { name: 'Astro Illustrations', category: 'Illustrations', avatar: <FaCube className={styles.productAvatar} /> },
    ];

    const balances = [
        { label: 'Current Balance', value: '$537' },
        { label: 'Pending', value: '$234' },
    ];

    if (loading) {
        return <div className={styles.loading}>Loading dashboard...</div>;
    }

    if (error) {
        return <div className={styles.error}>Error loading dashboard: {error}</div>;
    }

    return (
        <div className={styles.dashboardContainer}>
            <aside className={styles.sidebar}>
            <div className={styles.sidebarLogo}>
                <FaSyncAlt className={styles.sidebarLogoIcon} /> {/* Placeholder logo icon */}
                <span className={styles.sidebarLogoText}>ClubSync</span>
            </div>
                <div className={styles.sidebarNav}>
                    <div className={styles.adminTools}>Admin Tools</div>
                    <nav>
                        {menuItems.map(item => (
                            <NavLink
                                key={item.path}
                                to={item.path}
                                className={({ isActive }) =>
                                    `${styles.sidebarNavItem} ${isActive ? styles.sidebarNavItemActive : ''}`
                                }
                            >
                                {item.icon}
                                {item.label}
                            </NavLink>
                        ))}
                    </nav>
                </div>
                <div className={styles.sidebarSupport}>
                    <p className={styles.sidebarSupportText}>Have any problems with managing your dashboard? Contact our support.</p>
                    <button className={styles.sidebarSupportButton}>Contact Us</button>
                </div>
            </aside>

            <main className={styles.mainContent}>
                <header className={styles.header}>
                    <div className={styles.headerWelcome}>
                        Welcome Back, <span className={styles.headerUserName}>{clubInfo?.clubName || 'Lucy Lure'}</span>
                    </div>
                    <div className={styles.headerActions}>
                        <button className={styles.uploadButton}>
                            <FaUpload /> Upload Product
                        </button>
                        <div className={styles.searchBar}>
                            <FaSearch className={styles.searchIcon} />
                            <input type="text" placeholder="Search" className={styles.searchInput} />
                        </div>
                        <div className={styles.notificationIcon}>
                            <FaBell />
                            <span className={styles.notificationBadge}>2</span>
                        </div>
                    </div>
                </header>

                <div className={styles.dashboardGrid}>
                    <div className={`${styles.dashboardCard} ${styles.referralCard}`}>
                        <h3>Want some EXTRA Money?</h3>
                        <p>Refer a friend and earn 10% commission on every referral.</p>
                        <button className={styles.referralButton}>Referral Program</button>
                    </div>

                    <div className={`${styles.dashboardCard} ${styles.totalProductCard}`}>
                        <div className={styles.cardHeader}>
                            <FaProductHunt className={styles.cardHeaderIcon} />
                            <span className={styles.cardTitle}>Total Product</span>
                        </div>
                        <div className={styles.cardValue}>1,134 <span className={styles.cardUnit}>Items</span></div>
                        <div className={styles.cardTrend}>+10% this week</div>
                    </div>

                    <div className={`${styles.dashboardCard} ${styles.totalEarningCard}`}>
                        <div className={styles.cardHeader}>
                            <FaWallet className={styles.cardHeaderIcon} />
                            <span className={styles.cardTitle}>Total Earning</span>
                        </div>
                        <div className={styles.cardValue}>$4,231</div>
                        <div className={styles.cardTrend}>-22% this week</div>
                        {/* Placeholder for chart */}
                        <div>{/* Small chart here */}</div>
                    </div>

                    <div className={`${styles.dashboardCard} ${styles.lastDownloadCard}`}>
                        <div className={styles.cardHeader}>
                            <FaFileDownload className={styles.cardHeaderIcon} />
                            <span className={styles.cardTitle}>Lastest Download</span>
                        </div>
                        {/* Placeholder for larger chart */}
                        <div>{/* Larger chart here */}</div>
                        <div className={styles.cardValue}>350</div>
                    </div>

                    <div className={`${styles.dashboardCard} ${styles.topProductsCard}`}>
                        <h2>Top Products</h2>
                        {topProducts.map(product => (
                            <div key={product.name} className={styles.topProductItem}>
                                <div className={styles.productAvatar}>{product.avatar}</div>
                                <div className={styles.productInfo}>
                                    <div className={styles.productName}>{product.name}</div>
                                    <div className={styles.productCategory}>{product.category}</div>
                                </div>
                                <FaChevronRight className={styles.viewDetailsArrow} />
                            </div>
                        ))}
                    </div>

                    <div className={`${styles.dashboardCard} ${styles.balancesCard}`}>
                        <h2>Balances</h2>
                        {balances.map(balance => (
                            <div key={balance.label} className={styles.balanceItem}>
                                <div className={styles.balanceLabel}>{balance.label}</div>
                                <div className={styles.balanceValue}>{balance.value}</div>
                            </div>
                        ))}
                        <button className={styles.withdrawButton}>Withdraw Money</button>
                    </div>
                </div>
            </main>
        </div>
    );
};

export default ClubDashboard;
